import logo from './logo.svg';
import './App.css';

function App() {
  const name = "chitranjan";
  const sayHello  = true;
  const showMath  = false;


  let math;
  if( showMath ){
    math  = <h1>1+1={ 1+1 }</h1>
  }else{
    math  = null;
  }

  return (
    <div className="App">
      <h1>The App component</h1>
      { sayHello ?<h4>{name}</h4>:null }
      { math }
    </div>
  );
}

export default App;
